	 (2370392,1092357,NULL,NULL,'MIL',TIMESTAMP'2012-02-01 11:57:47','Milestone was undeclared.  SU:1  SSID:1153275  SMTC:RG No silviculture obligation for this block as it is wholly within the no harvest zone of the new GAR order-Mountain Caribou UWR #U-4-012, 4-013, and 4-014 effective Feb. 12, and 19, 2009. The new prioritiy within this UWR is now to maintain caribou habitat rather than to provide for future harvesting opportunities. Pursuant to Sect. 29 and Part 11 of the Forest and Range Practices Act (FRPA) there is no requirement to establish a free growing stand for  the block.\nInitiated by Kathy Smith, DM letter of approval attached (July 28, 2011) \nRob Borhi- RPF. February 1, 2012',NULL,'N',NULL,NULL,'IDIR\KCSMITH',TIMESTAMP'2012-02-01 11:57:47'),
	 (2370393,1092357,NULL,NULL,'MIL',TIMESTAMP'2012-02-01 11:57:59','Milestone was modified.',NULL,'N',NULL,NULL,'IDIR\KCSMITH',TIMESTAMP'2012-02-01 11:57:59'),
